import React, { useState } from 'react';
import { useEffect } from 'react';
import { Link } from 'react-router-dom';

import Sidebar from '../../../../sidebar/Sidebar';
import EditBorrower from './EditBorrower';

export default function Borrower({ setAuth }) {
  const [id, setId] = useState();
  const [name, setName] = useState();
  const [contactnumber, setContactNumber] = useState();
  const [address, setAddress] = useState();
  const [email, setEmail] = useState();
  const [username, setUsername] = useState();

  const getProfile = async () => {
    try {
      const response = await fetch('http://localhost:8000/profile', {
        method: 'GET',
        headers: { Authorization: localStorage.getItem('token') },
      });

      const parseRes = await response.json();
      // console.log(parseRes);

      setId(parseRes.id);
      setName(parseRes.firstname + ' ' + parseRes.lastname);
      setContactNumber(parseRes.contactnumber);
      setAddress(parseRes.address);
      setUsername(parseRes.username);
      setEmail(parseRes.email);
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    const interval = setInterval(() => {
      getProfile();
    }, 1000);
    return () => clearInterval(interval);
  }, []);
  return (
    <div>
      <div>
        <Sidebar />
        <div className='flex direct'>
          <EditBorrower />

          {/* Applicant Information */}

          <div className=''>
            <div className='w-full mx-auto px-8 pt-6 pb-8 mb-4 bg-white shadow-md rounded '>
              <div className='px-4 py-5 sm:px-6 bg-red-500'>
                <h3 className='text-lg font-medium leading-6 text-white'>
                  Applicant Information
                </h3>
                <p className='mt-1 max-w-2xl text-sm text-white'>
                  Personal details and application.
                </p>
              </div>
              <div className='flex md:flex-row flex-wrap m-5'>
                <div>
                  <img
                    src='https://cdn3.iconfinder.com/data/icons/red-icons-1/512/Male-profile-icon-512.png'
                    alt=''
                    className='flex align-center w-full md:w-3/4'
                  />
                </div>
                <dl>
                  {/* FULLNAME */}
                  <div className='bg-gray-50 px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>
                      Full name
                    </dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {name}
                    </dd>
                  </div>
                  {/* CONTACT NUMBER */}
                  <div className='bg-white px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>
                      Contact Number
                    </dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {contactnumber}
                    </dd>
                  </div>
                  {/* ADDRESS */}
                  <div className='bg-gray-50 px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>
                      Address
                    </dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {address}
                    </dd>
                  </div>
                  {/* ID */}
                  <div className='bg-white px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>ID</dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {id}
                    </dd>
                  </div>
                  {/* EMAIL ADDRESS */}
                  <div className='bg-gray-50 px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>
                      Email Address
                    </dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {email}
                    </dd>
                  </div>
                  {/* USERNAME */}
                  <div className='bg-white px-4 py-5 sm:grid sm:grid-cols-3 sm:gap-4 sm:px-6'>
                    <dt className='text-sm font-medium text-gray-600'>
                      Username
                    </dt>
                    <dd className='mt-1 text-sm text-gray-900 sm:col-span-2 sm:mt-0'>
                      {username}
                    </dd>
                  </div>
                  {/* Update Button */}
                  <button
                    type='submit'
                    className='w-full text-center py-3 rounded bg-red-500 text-white hover:bg-red-700 focus:outline-none my-1'
                  >
                    Update
                  </button>
                </dl>
                {/* UPDATE CLIENT INFO */}
                {/* <UpdateClient /> */}
              </div>
            </div>
            <div>
              <button
                className='bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-auto ml-12'
                type='submit'
                onClick={(e) => {
                  setAuth(false);
                }}
              >
                Log Out
              </button>
              <Link to='/'>
                <button
                  className='bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-auto ml-12'
                  onClick={(e) => {
                    setAuth(false);
                  }}
                >
                  Home
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
